import React, { useState, useEffect } from 'react';

const App = () => {
  const [counter, setCounter] = useState(0);

  useEffect(() => {
    console.log('Hello log!');
  }, []);

  return (
    <>
      <h1>
        {counter}
      </h1>
      <button onClick={() => setCounter(counter + 1)}>Increment</button>
    </>
  );
};

export default App;
